(107, 'Single  Separate Room for Rent for Male at Akalla', '764440001', 'Roomsharing@gmail.com', 'Ravi', 'Porkalagatan 7, Akalla, Stockholm', 'beside ICA', 4, '59.4174818', '17.9099554', 211, 3416, 39186, '16476', 5, 3, '0000-00-00', '0000-00-00', '', '', '<p>It\'s a 3 BR Apartment of 87 Sq.m on the 1st floor. Has a huge Football ground behind and a huge play area and greenery in the front.</p>\r\n<p>&nbsp;</p>\r\n<p>Very near to Bus Stop, Metro (T-Bana Akalla).</p>\r\n<p>Has many Grocery Stores like ICA, LIDL, and other with-in 300 metres radius.&nbsp;</p>\r\n<p>Two Vardcentrals within 300 meters.</p>\r\n<p>5 pre-schools and 3 Schools.</p>\r\n<p>Has good Transport facilities.</p>\r\n<p>&nbsp;</p>\r\n<p>This apartment will be shared by 4 guys. One guy is leaving from 1-Dec.&nbsp;You will be sharing the activities with us.</p>\r\n<p>&nbsp;</p>', 'Akalla, Shared_Accommodation, Single_Male', '', '', '', '', '', '160655747010_ways_to_love.jpg', 21, 0, 0, '2020-11-28', '2020-11-28 15:27:50', 0, 0, '0000-00-00 00:00:00', '', 0, '', 0, 'No', '', '', 'Semi Furnished', 'Appartment', 'Separate', 'Single', 'Male', '3', '1.5', '1', 1, 0, 1, '2020-12-01', '40000', 'SEK', 'Tenant', '2', '1', '<p>The room offered for rent is a separate room. It has a bed, Wardrobe.&nbsp; Has good ventilation and privacy.</p>\r\n<p>&nbsp;</p>', '<p>1-month advance and 1-month rent should be paid before occupying.</p>\r\n<p>Rent should be paid by the 27th of every month.</p>\r\n<p>1-month calendar notice.&nbsp;which means even if you give notice in the middle of the month. you still have to pay till the end of next month.</p>\r\n<p>&nbsp;</p>', 0, '', '', '0000-00-00', '0000-00-00', '', '', '', '', '', 0, 0, 0, '', 0, '', '', '', '', '', '', '0000-00-00'),
